import WrapperNoColor from '../components/UI/WrapperNoColor';
import ManagerCard from '../components/Managment/ManagerCard';
import classes from './OrganisationManagment.module.css';

import { Grid } from '@mui/material';

const OrganisationManagment = () => {
  return (
  <WrapperNoColor>
    <div className={classes["title-container"]}>
      <h1>LEADERSHIP</h1>
      <p className={classes.center}>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum. At nam minimum ponderum. Est audiam animal molestiae te. Ex duo eripuit mentitum.</p>
    </div>
    <Grid container spacing={2}>
      <Grid item xs={12} md={4}>
        <ManagerCard />
      </Grid>
      <Grid item xs={12} md={4}>
        <ManagerCard />
      </Grid>
      <Grid item xs={12} md={4}>
        <ManagerCard />
      </Grid>
    </Grid>
  </WrapperNoColor>
  )
};

export default OrganisationManagment;
